  input: TEXT,SA11A1,SA11A1.4933,"The Renal Leadership Council PAC does have very
    limited administrative expenses because the PAC is administered as part of a broad
    contract of services provided by Congressional Consultants (CC) for the Renal
    Leadership Council (RLC).  Services to administer the PAC by CC on behalf of the
    RLC are not broken out or separately reimbursed by the RLC.  Instead, the RLC
    pays a global monthly fee to CC for a broad range of government relations services.  The
    RLC is not a formal organization.  CC spends very little time administering the
    PAC. Having talked to Jim Krebs, Reports Analyst at the FEC, it was decided that
    in lieu of listing a salary, as one is not paid for administering the PAC, that
    the RLC should list an in-kind contribution to the RLC PAC for the administration
    of the PAC.  As a result, a $200.00 in-kind contribution from the RLC to the RLC
    PAC is noted here."
